def get_smoothed_values(data, window_size=10):
    smoothed_values = []
    for i in range(1, len(data)):
        truncated_data = data[:i]
        windowed_data = truncated_data[-window_size:]
        smoothed_values.append(np.average(windowed_data))
    return smoothed_values


